import React, { useState } from "react"
import { Moon, Sun } from "react-feather"
// import { useColorMode } from 'bumbag'

const DarkMode = () => {
  const {colorMode, setColorMode} = useColorMode('default')
  const toggle = () => setColorMode(colorMode)

  return <button color="#5863D8" onClick={toggle}><h3>Click here</h3></button>;
};
